import './App.css';
import {
  BrowserRouter as Router,
  Route,
} from "react-router-dom";
import Navbar from './Components/Navbar';
import Register from './Components/Register';

function App() {
  return (
      <div className="App">
        <h1>Hi</h1>
      <Navbar />
        < Router >
              <Route path='register/'>
                <Register />
              </Route>
        < /Router>
    </div>
  );
}

export default App;
